  Code = "class Solution:\n    def vowelStrings(self, words: List[str], left: int, right: int) -> int:\n        res = 0\n        vowels = (\"a\", \"e\", \"i\", \"o\", \"u\")\n        for i in range(left, right + 1):\n            word = words[i]\n            if word[0] in vowels and word[-1] in vowels:\n                res += 1\n        return res"
